   "source": [
    "# Calculate WQI\n",
    "index_df$wqi <- round(\n",
    "    rowMeans(subset(index_df, \n",
    "                    select = c(\n",
    "                        turbidity_si, \n",
    "                        ss_si, \n",
    "                        dissolved_oxygen_si, \n",
    "                        bod5_si, \n",
    "                        cod_si, \n",
    "                        t_carbon_si, \n",
    "                        t_nitrogen_si, \n",
    "                        t_phosphorus_si, \n",
    "                        faecal_coliform_si)), \n",
    "             na.rm = TRUE))\n",
    "\n",
    "river <- index_df %>%\n",
    "  mutate(year = year(dates)) %>% \n",
    "  mutate(month = month(dates)) %>% \n",
    "  subset(select = c(water_control_zone, river, station, year, month, wqi)) %>% \n",
    "  group_by(water_control_zone, river, year) %>% \n",
    "  summarise(wqi = round(mean(wqi)))\n",
    "\n",
    "head(river)"
   ]
  },
